var lengthOfLongestSubstring = function (s) {
  // if (s.length === 1) return 1;
  let startIndex = 0;
  let endIndex = 0;
  let result = 0;
  const seenChars = new Map();
  while (endIndex < s.length) {
    if (seenChars.get(s[endIndex]) === undefined) {
      seenChars.set(s[endIndex], endIndex);
      endIndex += 1;
      console.log();
    } else {
      result = max(result, endIndex - startIndex);
      startIndex = seenChars.get(s[endIndex]) + 1;
      for (const key of seenChars.keys()) {
        if (seenChars.get(key) < startIndex) {
          seenChars.delete(key);
        }
      }
      console.log();
    }
  }
  result = max(result, endIndex - startIndex);
  return result;
};

var max = function (x, y) {
  if (x > y) return x;
  return y;
};

